import React from "react";
import Header from "./Header.jsx";
import Footer from "./Footer.jsx";
import Note from "./Note.jsx";
import notes from "../notes.js";



function App(){
  return <div>
  <Header />
   <Footer />
   {notes.map(noteItem => (
  
    <Note
      key={noteItem.key}
      title={noteItem.title}
      content={noteItem.content}
    />

))}
  </div>
};

export default App
